import { webSocket } from 'rxjs/webSocket'


const createWebSocketConnection = ({
  url,
  params,
}) => {

  const  query = new URLSearchParams(params).toString()
  return webSocket({
    url: `${url}?${query}`
  })
}




  export const wsService = {
    createWebSocketConnection,
};
